import React from 'react';
import styled from 'styled-components';

const Modal = () => {
  return (
    <>
        <Overlay>
            <ContenedorModel>
                <h1></h1>
            </ContenedorModel>
        </Overlay>
    </>
  )
}

export default Modal;

const Overlay = styled.div `
    width: 100vw;
    height: 100vh;
    position: fixed;
    top: 0;
    left: 0;
    background: rgba(0,0,0,.5);
`;

const ContenedorModel = styled.div ` 
    width: 500px;
    min-height: 100px;
    background: #fff;
    
`;
